window.bookSummaryJSON = "<p>He’s the wildest guy in his band, but falling for a virgin groupie-in-disguise might be his craziest move yet.</p> <p>Keyboardist West Reynolds’s idea of commitment? Going out for breakfast with a woman after a night of bed-breaking action. The only thing he gets serious about is Warning Sign, the band he formed with his two best friends. Then he meets a woman being hauled off by security, and she’s fascinated by him.</p> <p>To her, he’s a subject to study. Like a bug under a microscope with a big…head.</p> <p>Lauren Bryant is a student of psychology, and now she’s going in depth on rockstars. Specifically, fans. What makes a woman turn into a lust-driven groupie?</p> <p>Is it the music?</p> <p>The fame?</p> <p>The men?</p> <p>She isn’t sure, but she never expected to get her own night with a rockstar. One where he’s on top, doing some studying of his own....</p> <p>She isn’t sure, but she never expected to get her own night with a rockstar. And she just figured out the ultimate way to get inside a subject is to let the subject inside you....</p>"; 
